contracts/2_variable_modifiers.sol.content:
// SPDX-License-Identifier: MIT

// Version
pragma solidity ^0.8.4;

contract VariableModifiers {

    // Integer values without sign (uint)
    uint a;
    uint8 b = 255;
    uint16 public c = 811;

    // Integer values with sign (int)
    int d = -255;
    int32 public e = -255;

    // String
    string public surname;
    string name = "Roberto";
    string public pl = "Solidity";

    // Booleans
    bool boolean;
    bool public boolTrue = true;
    bool public boolFalse = false;

    // Bytes
    bytes32 testingBytes;
    bytes4 lessBytes;
    bytes8 eightBytes;
    bytes oldBytesCrash;

    // Hash Algorithm
    bytes32 public hash = keccak256(abi.encodePacked(name, surname));

    // Address
    address myAddress;
    address public friendAddress = 0x5B38Da6a701c568545dCfcB03FcB875f56beddC4;
    address public owner = msg.sender;

    // Enumerates
    enum tokens {ADA, ETHER, BNB, BTC}
    // tokens state;
    tokens constant defaultChoice = tokens.BTC;
}

